INSERT INTO `aboutTroupe` (`id`, `about`, `created_at`, `updated_at`)
VALUES
	(1,'Directed by Christian Mayer, \"The OBCT Senior Troupe\" is our award-winning musical theatre competition troupe designed for serious \"triple threat\" performers who live and breathe the theatre. Each year a small cast of performers, ranging in age from 10 - 15, are chosen to be members of the Troupe. After a lengthy audition process in mid August, the OBCT Senior Troupe rehearse their show an average of 6 hours a week over a 7 month period, in addition to polishing their acting, dance and vocal skills via weekly lessons.',NULL,NULL),
	(2,'Their hard work pays off in terms of a wonderful camaraderie among cast members, an exciting full production in our blackbox theatre, performances at local festivals and charity events, and the thrill of competing with other theatre and drama teams across the United States. Alumni of the 12 year program, can be found appearing as the top performers at Milton High School, West Forsyth High School, Pebblebrook Performing Arts High School, North Springs Performing Arts High School as well as many prestigious Theatre programs in Universities such as Emerson, Oklahoma University, Elon, Auburn, Cincinnati Conservatory and Pace as well as many others throughout the United States. This troupe travels to The National Performing Arts Festival in Walt Disney World each year to compete against theatres from around the nation.',NULL,NULL);

