VALUES
	(1,'Alice In Wonderland','OBCT brings Disney\'s Alice In Wonderland alive in our theatre this year!','4/21 - 5/6',X'','2/6','2pm - 5pm','Off Broadway Children\'s Theatre is pleased to announce auditions for Alice in Wonderland Jr. on Feb. 6th for ages 8-17  from 2pm-5pm. Auditionees should prepare 30 seconds of a musical theatre song to sing, be prepared to learn a short dance and read from the script.','If cast, there is a 200.00 production fee. This show will rehearse Mon. nights 6pm-8pm and Saturday afternoons 2pm-4pm. Shows will be 6 performances running end of April beginning of May. For an audition slot, please email us at Offbroadway@msn.com',0),
	(2,'Shrek Jr.','OBCT brings Shrek and Donkey alive in our theatre this year!','8/5 - 8/14',X'','5/18 &amp; 520','6:30 - 730pm &amp; 2:00 - 5:00pm','Off Broadway Children\'s Theatre is pleased to announce auditions for Shrek Jr. dates 5/18- 6:00-7:30- and on May 21- 2:00-5:00- show dates August 5-August 14. This audition is open to kids ages 8-17. Auditionees should prepare 30 seconds of a musical theatre selection to sing and be prepared to learn a short dance and cold read from the script.','If cast, there is a 200.00 production fee. Rehearsals will be held on a couple of days a week, however we will be flexible with summer vacations. For an audition appointment, please email us at offbroadway@msn.com.',1);

