INSERT INTO `summer` (`id`, `show_title`, `ages`, `dates`, `time`, `cost`, `show_dates`, `show_info`, `show_image`)
VALUES
	(1,'Elf Jr','9-17','June 6 - June 18','10am - 4pm','335','June 17,18 and 19th','Buddy, a young orphan mistakenly crawls into Santa\'s bag of gifts and is transported to the North Pole. The would-be elf is raised unaware that he is actually a human, until his enormous size and poor toy-making abilities cause him to face the truth. With Santa\'s permission, Buddy embarks on a journey to New York City to find his birth father and discover his true identity. Faced with the harsh reality that his father is on the naughty list, and his stepbrother doesn\'t even believe in Santa, Buddy is determined to win over his new family and help New York remember the true meaning of Christmas',X'');

INSERT INTO `summer` (`id`, `show_title`, `ages`, `dates`, `time`, `cost`, `show_dates`, `show_info`, `show_image`)
VALUES
	(2,'Aladdin Kids','5-12','July 11 - July 23','10am - 3pm','285','July 15, 16 and 17th','When the street urchin Aladdin vies for the attention of the beautiful princess Jasmine, he uses a genie\'s magic power to become a prince in order to marry her.  Iago, Jafar, the Genie, and more are here in Disney?s Aladdin KIDS, a musical adventure filled with magic, mayhem, and the power of love. Specific to Disney?s Aladdin KIDS are the Junior Djinn, a group of unique stage magicians who execute the magical moments of the show.',X''),
	(3,'High School Musical and More','7 - 16','June 20 - June 24','10am - 2pm','185','TBD','Come spend a week at East High as we are all in this together. We will hit the highlights and dance our way to the top. Don?t get stuck to the status quo this summer and get your head in the game. Who knows it just might be the start of something new. So break free and come play with us at OBCT.',X''),
	(4,'Cirque Du Off-Broadway!','9-14','June 20-24 | June 27- July 1','10am - 12pm','75','TBD','Explore the art of circus-style object manipulation! Many new and exciting skills will be taught each day including: hula hooping tricks, juggling, plate spinning, poi, Chinese yo-yo, balloon animals, and much more wacky clowning fun! the week will finish off with a spectacular performance showcasing the weeks new talents.\n\n\nLaura Sidwell is a 16 year old rising junior at Milton High school. Through Milton Theatre Company, she is a part of the Advanced Drama and Cirque programs. Prior to High school Laura was an avid participant in troupe shows, dance classes, and much more at OBCT since the age of 3. Laura is so grateful to be able to give back her knowledge in the place that she can call home.',X'');

/*!40000 ALTER TABLE `summer` ENABLE KEYS */;
UNLOCK TABLES;


