INSERT INTO `teachers` (`id`, `name`, `about`, `image`, `created_at`, `updated_at`)
VALUES
	(1,'Shannon Mayer','Shannon Hannah Mayer became Owner/Director of Off Broadway Children\'s Theatre in June of 2000. A native of Dothan, Alabama, she began her training in dance at the early age of 8 years old. Shannon received a Bachelor of Arts in Theatre from Brenau Women\'s College in Gainesville, Georgia. She went on to pursue a career in musical theatre and dance which has given her the opportunity to perform throughout the southeastern United States. Shannon has appeared as a performer for Discovery Cruise Lines, as a performer and Dance Captain for the Savoyards Musical Theatre Company and is the resident choreographer for many north Georgia theatre companies as well as remaining an active performer. She is dedicated to the education of children and the commitment to helping the community.',X'',NULL,NULL),
	(2,'Christian Mayer','Christian Mayer is Artistic Director and Owner of the Off Broadway Children\'s Theatre in Alpharetta, Ga. He has produced and directed over 50 children\'s productions and has mentored, coached and groomed hundreds of kids. He began his acting career in 1981, and has performed in such notable shows as \"House of Blue Leaves\", \"Two for the Seesaw\", \"Bent\", \"Hatful of Rain\", \"Homefront\", \"The Mouestrap\" \"The Elephant Man\",\"Loot\" and was lucky enough to have proposed to his wife onstage in \"Annie\". Christian believes that theatre is a journey and that theatre is about the work of the whole, not the individual.',X'',NULL,NULL),
	(3,'Erin Greenway','Erin Greenway studied acting, dance, choreography, and photography in the States and abroad. While in London, she had an apprenticeship with the English National Ballet.  While with the Ballet she participated in the Community Education program exposing elementary schools, elderly groups, and children\'s hospitals to the world of ballet.  After moving back to the states, she helped to set up Greensboro, North Carolina\'s first Arts Advocacy Council, and taught dance to elementary school children with learning disabilities.  Companies that Erin has worked with include Spitzer Dance Company, Offshoot Productions, Lee Harper and Dancers, Stage Door Players, Ansley Park Playhouse, Jib Jam Productions, Odd Man Out Theatre, Rosewater Theatre, Performing Arts North Theatre Decatur, Academy Theatre, and extensively with Savage Tree Arts Project.  Erin is also the Chair of Fine Arts department at the Brandon Hall School and is an company member of Performing Arts North Repertory Company.',X'',NULL,NULL),
	(4,'Amy Noel Welch','Amy has been teaching and playing in the Atlanta area for many years. She attended Georgia State University, majoring in music education and is proficient on trumpet and piano, as well as voice. Being the music director for Elm Street Cultural Arts Village in Woodstock since 2009, she has worked on over 30 shows and is in high demand as an accompanist in Cherokee County schools and the community.',X'',NULL,NULL);

/*!40000 ALTER TABLE `teachers` ENABLE KEYS */;
UNLOCK TABLES;


